import React from 'react';


class MainTabContent extends React.Component{
  render() {
    return (
      <div className="tab-content">
        <div href="../Search/flight.js" className="tab-pane active"></div>
        <div className="tab-pane "></div>
        <div className="tab-pane "></div>
      </div>
    )
  }
}
export default MainTabContent
